import React, { useEffect } from 'react';
import PropTypes from 'prop-types';
import Spinner from '../layout/Spinner';
import {Link, Redirect} from 'react-router-dom';
import { connect } from 'react-redux';
import { getTeacherProfile } from '../../actions/profile';

const DashboardTeacher = ({
  getTeacherProfile,
  user,
  myProfile: {
    name,
    invitedByMe,
    inviter,
    user:
    userProfile
  }}) => {

  return (
    <>
      <h1 className="large text-primary">
        Panel nauczyciela
      </h1>
      <p className="lead"><i className="fas fa-user"></i> Witaj {name}</p>
      <h3>Link do twojej grupy:</h3>
      <h5>{`${window.location.origin}/register/${user._id}`}</h5>
      <h4>Zaproszeni przez Ciebie</h4>
      <ul>
        { invitedByMe.length > 0 && invitedByMe.map(({user}) =>(
          <li className="posts">
            <Link onClick={()=>getTeacherProfile(user._id)} to='/teacher'>{user.name}</Link>
          </li>
        ))}
      </ul>
      { inviter !== userProfile ?
        <>
          <h4>Twój szef</h4>
          <h5 onClick={()=>viewProfile(inviter._id)}>
          { inviter.name }
          <Link onClick={()=>getTeacherProfile(inviter._id)} to='/teacher'>{user.name}</Link>

          </h5>
        </> : <h4>Jesteś pierwszy w naszej strukturze</h4>
        }
    </>
)
};

DashboardTeacher.propTypes = {
  profile: PropTypes.object.isRequired,
  user: PropTypes.object.isRequired
};

export default connect(null,{getTeacherProfile})(DashboardTeacher);
